'''Bolongo''' is a [[gnome]] [[Group of Advanced Gardeners|gardener]] who looks after the fruit tree [[farming]] patch at the [[Gnome Stronghold]]. Players can use him as one of the 5 gardeners during the [[Fairytale I - Growing Pains]] [[quest]].

==Shop==
Bolongo also sells basic farming tools, which can be accessed by talking to him and asking ''Can you sell me something?'' It is not an actual shop and it has no set stock; each item has to be bought individually through the dialogue.
